import "./App.css";
import PowerBI from "./Components/powerbi_poc";

function App() {
  return (
    <div className="App">
      <div>
        <img src="../Images/"></img>
        <h1>Total Portfolio Optimization Demo</h1>
        <p>This is a demo of embeding PowerBI Reports</p>
      </div>
      <PowerBI height="100%"></PowerBI>
    </div>
  );
}

export default App;
